using System;
using System.Collections.Generic;
using AutoMapper;
using Newtonsoft.Json;
using SmartRestaurant.Application.Common.Dtos;
using SmartRestaurant.Application.Common.Dtos.DishDtos;
using SmartRestaurant.Application.Dishes.Commands;
using SmartRestaurant.Application.Tests.Configuration;
using SmartRestaurant.Domain.Entities;
using SmartRestaurant.Domain.Enums;
using SmartRestaurant.Domain.ValueObjects;
using Xunit;

namespace SmartRestaurant.Application.Tests.MappingTests
{
    public class DishMappingTest : IClassFixture<MappingTestsFixture>
    {
        private readonly IMapper _mapper;
        private string Picture = @"";
        private string UpdatePicture = @"";
        public DishMappingTest(MappingTestsFixture fixture)
        {
            _mapper = fixture.Mapper;
        }

        [Fact]
         public void Map_CreateDishCommand_To_Dish_Valide_Test()
        {
            var createDishCommand = new CreateDishCommand
            {
                Name = "Fakhitasse",
                Description = "Fakhitasse description",
                Picture = Picture,
                Price = 280,
                FoodBusinessId = Guid.NewGuid().ToString(),
                Specifications = new List<DishSpecificationDto>() {
                    new  DishSpecificationDto()   {ContentType =  ContentType.CheckBox, Title = "Slaty", CheckBoxContent = false},
                    new  DishSpecificationDto()   {ContentType = ContentType.ComboBox,  Title = "Cuission", ComboBoxContent = new List<string>() {"Bien Cuite", "Demi cuisson" } }
                },
                Ingredients = new List<DishIngredientCreateDto>() {
                    new  DishIngredientCreateDto()   {
                        InitialAmount = 20,
                        MinimumAmount = 10,
                        MaximumAmount = 50,
                        MeasurementUnits = MeasurementUnits.KiloGramme,
                        AmountIncreasePerStep = 10,
                        PriceIncreasePerStep = 20,
                        IngredientId = Guid.NewGuid().ToString()
                    },
                },
                Supplements = new List<DishSupplementCreateDto>() {
                    new  DishSupplementCreateDto()   {SupplementId =  Guid.NewGuid().ToString()},
                    new  DishSupplementCreateDto()   {SupplementId =  Guid.NewGuid().ToString()},
                },
                IsSupplement = true,
                EstimatedPreparationTime = 1200
            };

            var dish = _mapper.Map<Dish>(createDishCommand);
            Assert.Equal(dish.DishId, createDishCommand.Id);
            Assert.Equal(dish.Name, createDishCommand.Name);
            Assert.Equal(dish.Price, createDishCommand.Price);
            Assert.Equal(dish.FoodBusinessId, Guid.Parse(createDishCommand.FoodBusinessId));
            Assert.Equal(dish.IsSupplement, createDishCommand.IsSupplement);
            Assert.Equal(dish.EstimatedPreparationTime, createDishCommand.EstimatedPreparationTime);
            Assert.Equal(dish.Picture, Convert.FromBase64String(createDishCommand.Picture));

            Assert.Equal(dish.Specifications[0].Title, createDishCommand.Specifications[0].Title);
            Assert.Equal(dish.Specifications[0].ContentType, createDishCommand.Specifications[0].ContentType);
            Assert.Equal(dish.Specifications[0].CheckBoxContent, createDishCommand.Specifications[0].CheckBoxContent);
            Assert.Null(dish.Specifications[0].ComboBoxContent);
            Assert.Equal(dish.Specifications[1].Title, createDishCommand.Specifications[1].Title);
            Assert.Equal(dish.Specifications[1].ContentType, createDishCommand.Specifications[1].ContentType);
            Assert.Equal(dish.Specifications[1].CheckBoxContent, createDishCommand.Specifications[1].CheckBoxContent);
            Assert.Equal(dish.Specifications[1].ComboBoxContent, string.Join(";", dish.Specifications[1].ComboBoxContent));

            Assert.Equal(dish.Ingredients[0].InitialAmount, createDishCommand.Ingredients[0].InitialAmount);
            Assert.Equal(dish.Ingredients[0].MinimumAmount, createDishCommand.Ingredients[0].MinimumAmount);
            Assert.Equal(dish.Ingredients[0].MaximumAmount, createDishCommand.Ingredients[0].MaximumAmount);
            Assert.Equal(dish.Ingredients[0].AmountIncreasePerStep, createDishCommand.Ingredients[0].AmountIncreasePerStep);
            Assert.Equal(dish.Ingredients[0].PriceIncreasePerStep, createDishCommand.Ingredients[0].PriceIncreasePerStep);
            Assert.Equal(dish.Ingredients[0].IngredientId, Guid.Parse(createDishCommand.Ingredients[0].IngredientId));

            Assert.Equal(dish.Supplements[0].SupplementId, Guid.Parse(createDishCommand.Supplements[0].SupplementId));
            Assert.Equal(dish.Supplements[1].SupplementId, Guid.Parse(createDishCommand.Supplements[1].SupplementId));






        }

        [Fact]
        public void Map_UpdateDishCommand_To_Dish_Valide_Test()
        {
            var foodBusinessId = Guid.NewGuid();
            var dish = new Dish
            {
                DishId = Guid.NewGuid(),
                Name = "Fakhitasse",
                Description = "Fakhitasse description",
                Picture = Convert.FromBase64String(Picture),
                Price = 280,
                FoodBusinessId = foodBusinessId,
                Specifications = new List<DishSpecification>() {
                    new  DishSpecification()   {ContentType =  ContentType.CheckBox, Title = "Slaty", CheckBoxContent = false},
                    new  DishSpecification()   {ContentType = ContentType.ComboBox,  Title = "Cuission", ComboBoxContent = "Bien Cuite;Demi cuisson" }
                },
                Ingredients = new List<DishIngredient>() {
                    new  DishIngredient()   {
                        InitialAmount = 20,
                        MinimumAmount = 10,
                        MaximumAmount = 50,
                        MeasurementUnits = MeasurementUnits.KiloGramme,
                        AmountIncreasePerStep = 10,
                        PriceIncreasePerStep = 20,
                        IngredientId = Guid.NewGuid()
                    },
                },
                Supplements = new List<DishSupplement>() {
                    new  DishSupplement()   {SupplementId =  Guid.NewGuid()},
                    new  DishSupplement()   {SupplementId =  Guid.NewGuid()},
                },
                IsSupplement = true,
                EstimatedPreparationTime = 1200
            };


            var updateDishCommand = new UpdateDishCommand
            {
                Id = dish.DishId.ToString(),
                Name = "Fakhitasse modified",
                Description = "Fakhitasse description modified",
                Picture = UpdatePicture,
                Price = 280,
                Specifications = new List<DishSpecificationDto>() {
                    new  DishSpecificationDto()   {ContentType =  ContentType.CheckBox, Title = "Slaty modified", CheckBoxContent = true},
                    new  DishSpecificationDto()   {ContentType = ContentType.ComboBox,  Title = "Cuission modified", ComboBoxContent = new List<string>() { "Bien Cuite modified", "Demi cuisson modified" } }
                },
                Ingredients = new List<DishIngredientCreateDto>() {
                    new  DishIngredientCreateDto()   {
                        InitialAmount = 25,
                        MinimumAmount = 15,
                        MaximumAmount = 55,
                        MeasurementUnits = MeasurementUnits.Gramme,
                        AmountIncreasePerStep = 15,
                        PriceIncreasePerStep = 25,
                        IngredientId = Guid.NewGuid().ToString()
                    },
                },
                Supplements = new List<DishSupplementCreateDto>() {
                    new  DishSupplementCreateDto()   {SupplementId =  Guid.NewGuid().ToString()},
                    new  DishSupplementCreateDto()   {SupplementId =  Guid.NewGuid().ToString()},
                },
                IsSupplement = true,
                EstimatedPreparationTime = 1200
            };

            _mapper.Map(updateDishCommand, dish);

            Assert.Equal(dish.DishId, Guid.Parse(updateDishCommand.Id));
            Assert.Equal(dish.Name, updateDishCommand.Name);
            Assert.Equal(dish.Price, updateDishCommand.Price);
            Assert.Equal(dish.FoodBusinessId, foodBusinessId);
            Assert.Equal(dish.IsSupplement, updateDishCommand.IsSupplement);
            Assert.Equal(dish.EstimatedPreparationTime, updateDishCommand.EstimatedPreparationTime);
            Assert.Equal(dish.Picture, Convert.FromBase64String(updateDishCommand.Picture));

            Assert.Equal(dish.Specifications[0].Title, updateDishCommand.Specifications[0].Title);
            Assert.Equal(dish.Specifications[0].ContentType, updateDishCommand.Specifications[0].ContentType);
            Assert.Equal(dish.Specifications[0].CheckBoxContent, updateDishCommand.Specifications[0].CheckBoxContent);
            Assert.Null(dish.Specifications[0].ComboBoxContent);
            Assert.Equal(dish.Specifications[1].Title, updateDishCommand.Specifications[1].Title);
            Assert.Equal(dish.Specifications[1].ContentType, updateDishCommand.Specifications[1].ContentType);
            Assert.Equal(dish.Specifications[1].CheckBoxContent, updateDishCommand.Specifications[1].CheckBoxContent);
            Assert.Equal(dish.Specifications[1].ComboBoxContent, string.Join(";", dish.Specifications[1].ComboBoxContent));

            Assert.Equal(dish.Ingredients[0].InitialAmount, updateDishCommand.Ingredients[0].InitialAmount);
            Assert.Equal(dish.Ingredients[0].MinimumAmount, updateDishCommand.Ingredients[0].MinimumAmount);
            Assert.Equal(dish.Ingredients[0].MaximumAmount, updateDishCommand.Ingredients[0].MaximumAmount);
            Assert.Equal(dish.Ingredients[0].AmountIncreasePerStep, updateDishCommand.Ingredients[0].AmountIncreasePerStep);
            Assert.Equal(dish.Ingredients[0].PriceIncreasePerStep, updateDishCommand.Ingredients[0].PriceIncreasePerStep);
            Assert.Equal(dish.Ingredients[0].IngredientId, Guid.Parse(updateDishCommand.Ingredients[0].IngredientId));

            Assert.Equal(dish.Supplements[0].SupplementId, Guid.Parse(updateDishCommand.Supplements[0].SupplementId));
            Assert.Equal(dish.Supplements[1].SupplementId, Guid.Parse(updateDishCommand.Supplements[1].SupplementId));

        }

        [Fact]
        public void Map_Dish_To_DishDto_Valide_Test()
        {
            var dish = new Dish
            {
                DishId = Guid.NewGuid(),
                Name = "Fakhitasse",
                Description = "Fakhitasse description",
                Picture = Convert.FromBase64String(Picture),
                Price = 280,
                FoodBusinessId = Guid.NewGuid(),
                Specifications = new List<DishSpecification>() {
                    new  DishSpecification()   {ContentType =  ContentType.CheckBox, Title = "Slaty", CheckBoxContent = false},
                    new  DishSpecification()   {ContentType = ContentType.ComboBox,  Title = "Cuission", ComboBoxContent = "Bien Cuite;Demi cuisson" }
                },
                Ingredients = new List<DishIngredient>() {
                    new  DishIngredient()   {
                        InitialAmount = 20,
                        MinimumAmount = 10,
                        MaximumAmount = 50,
                        MeasurementUnits = MeasurementUnits.KiloGramme,
                        AmountIncreasePerStep = 10,
                        PriceIncreasePerStep = 20,
                        IngredientId = Guid.NewGuid(),
                        Ingredient = new Ingredient {
                            IngredientId = Guid.NewGuid(),
                            Names = @"[{'name':'Black pepper','language':'en'},{'name':'الفلفل الاسود','language':'ar'},{'name':'Le poivre noir','language':'fr'}]",
                            EnergeticValue = new EnergeticValue
                            {
                                Amount = 10,
                                MeasurementUnit = MeasurementUnits.Gramme,
                                Fat = 2,
                                Protein = 1,
                                Carbohydrates = 3,
                                Energy = 10
                            },
                            Picture = new byte[3] { 22, 23, 25 }
                        }
                    },
                },
                Supplements = new List<DishSupplement>() {
                    new  DishSupplement()   { 
                        SupplementId =  Guid.NewGuid(),
                        Supplement = new Dish()
                        {
                            DishId = Guid.NewGuid(),
                            Name = "Takouse Supplement",
                            Description = "Takouse Supplement description",
                            Picture = Convert.FromBase64String(Picture),
                            Price = 450,
                        }
                    } 
                },
                IsSupplement = true,
                EstimatedPreparationTime = 1200
            };

            var dishDto = _mapper.Map<DishDto>(dish);
            Assert.Equal(dishDto.DishId, dish.DishId);
            Assert.Equal(dishDto.Name, dish.Name);
            Assert.Equal(dishDto.Price, dish.Price);
            Assert.Equal(dishDto.FoodBusinessId, dish.FoodBusinessId);
            Assert.Equal(dishDto.IsSupplement, dish.IsSupplement);
            Assert.Equal(dishDto.EstimatedPreparationTime, dish.EstimatedPreparationTime);
            Assert.Equal(dishDto.Picture, Convert.ToBase64String(dish.Picture));


            Assert.Equal(dishDto.Specifications[0].Title, dish.Specifications[0].Title);
            Assert.Equal(dishDto.Specifications[0].ContentType, dish.Specifications[0].ContentType);
            Assert.Equal(dishDto.Specifications[0].CheckBoxContent, dish.Specifications[0].CheckBoxContent);
            Assert.Equal(dishDto.Specifications[0].ComboBoxContent, new string[0]);
            Assert.Equal(dishDto.Specifications[1].Title, dish.Specifications[1].Title);
            Assert.Equal(dishDto.Specifications[1].ContentType, dish.Specifications[1].ContentType);
            Assert.Equal(dishDto.Specifications[1].CheckBoxContent, dish.Specifications[1].CheckBoxContent);
            Assert.Equal(dishDto.Specifications[1].ComboBoxContent, dish.Specifications[1].ComboBoxContent.Split(';'));


            Assert.Equal(dishDto.Ingredients[0].InitialAmount, dish.Ingredients[0].InitialAmount);
            Assert.Equal(dishDto.Ingredients[0].MinimumAmount, dish.Ingredients[0].MinimumAmount);
            Assert.Equal(dishDto.Ingredients[0].MaximumAmount, dish.Ingredients[0].MaximumAmount);
            Assert.Equal(dishDto.Ingredients[0].AmountIncreasePerStep, dish.Ingredients[0].AmountIncreasePerStep);
            Assert.Equal(dishDto.Ingredients[0].PriceIncreasePerStep, dish.Ingredients[0].PriceIncreasePerStep);
            Assert.Equal(dishDto.Ingredients[0].Ingredient.IngredientId, dish.Ingredients[0].Ingredient.IngredientId);
            var IngredientNames = JsonConvert.DeserializeObject<List<IngredientNameDto>>(dish.Ingredients[0].Ingredient.Names);
            Assert.Contains(dishDto.Ingredients[0].Ingredient.Names, x => x.Name == IngredientNames[0].Name);
            Assert.Contains(dishDto.Ingredients[0].Ingredient.Names, x => x.Language == IngredientNames[0].Language);
            Assert.Contains(dishDto.Ingredients[0].Ingredient.Names, x => x.Name == IngredientNames[1].Name);
            Assert.Contains(dishDto.Ingredients[0].Ingredient.Names, x => x.Language == IngredientNames[1].Language);
            Assert.Contains(dishDto.Ingredients[0].Ingredient.Names, x => x.Name == IngredientNames[2].Name);
            Assert.Contains(dishDto.Ingredients[0].Ingredient.Names, x => x.Language == IngredientNames[2].Language);
            Assert.Equal(dishDto.Ingredients[0].Ingredient.EnergeticValue.Amount, dish.Ingredients[0].Ingredient.EnergeticValue.Amount);
            Assert.Equal(dishDto.Ingredients[0].Ingredient.EnergeticValue.MeasurementUnit, dish.Ingredients[0].Ingredient.EnergeticValue.MeasurementUnit);
            Assert.Equal(dishDto.Ingredients[0].Ingredient.EnergeticValue.Fat, dish.Ingredients[0].Ingredient.EnergeticValue.Fat);
            Assert.Equal(dishDto.Ingredients[0].Ingredient.EnergeticValue.Protein, dish.Ingredients[0].Ingredient.EnergeticValue.Protein);
            Assert.Equal(dishDto.Ingredients[0].Ingredient.EnergeticValue.Carbohydrates, dish.Ingredients[0].Ingredient.EnergeticValue.Carbohydrates);
            Assert.Equal(dishDto.Ingredients[0].Ingredient.EnergeticValue.Energy, dish.Ingredients[0].Ingredient.EnergeticValue.Energy);
            Assert.Equal(dishDto.Ingredients[0].Ingredient.Picture, Convert.ToBase64String(dish.Ingredients[0].Ingredient.Picture));


            Assert.Equal(dishDto.Supplements[0].DishId, dish.Supplements[0].Supplement.DishId);
            Assert.Equal(dishDto.Supplements[0].Description, dish.Supplements[0].Supplement.Description);
            Assert.Equal(dishDto.Supplements[0].EnergeticValue, dish.Supplements[0].Supplement.EnergeticValue);
            Assert.Equal(dishDto.Supplements[0].Name, dish.Supplements[0].Supplement.Name);
            Assert.Equal(dishDto.Supplements[0].Picture, Convert.ToBase64String(dish.Supplements[0].Supplement.Picture));
            Assert.Equal(dishDto.Supplements[0].Price, dish.Supplements[0].Supplement.Price);
        }
    }
}